import { useEffect, useState } from "react";
import CreateReadForm from "../CreateReadForm";

const ReadBooks = ({ user }) => {

      return (
          <div>
            <CreateReadForm />
                {!user ? <h2>Not logged in</h2> : 
                    user.readBook.map((book) => {
                        return (
                            <div>
                                <h2>{book.title}</h2>
                                <h3>{book.author}</h3>
                            </div>
                        )
                    })

                }

            </div>
      )
}

  export default ReadBooks;
